import React from 'react';

function OutgoingMsg({ msgs }) {
  return (
    <div className="outgoing">
      {msgs?.map(({ message, user, current_time }) => {
        return (
          <div key={Math.random()} className="bubble">
            <span>{user}</span>
            {message}
            <span className="message-time">{current_time}</span>
          </div>
        );
      })}
    </div>
  );
}

export default OutgoingMsg;
